import { useState } from "react";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function Registration(){
    return <Box
    component="form"
    sx={{
      '& .MuiTextField-root': { m: 1, width: '25ch' },
    }}
    noValidate
    autoComplete="off"
  >
      <TextField
          required
          id="outlined-required"
          label="Name"
        />
  </Box>
}
